import React from "react";
import { useState } from "react";

const Field = () => {
  const [val, setVal] = useState("");
  return (
    <>
      <input
        type="text"
        value={val}
        onChange={(e) => {
          setVal((countryValue = e.target.value));
        }}
      />
      <input type="Submit" />
    </>
  );
};

export default Field;
